import React from 'react';

const AdminDashboard  = React.lazy(() => import('./modules/courses'));
const Categories  = React.lazy(() => import('./modules/courses/Categories'));
const Courses  = React.lazy(() => import('./modules/courses/Courses'));
const Sections  = React.lazy(() => import('./modules/courses/Sections'));
const Topics  = React.lazy(() => import('./modules/courses/Topics'));
const Orders = React.lazy(() => import('./modules/courses/Orders'));

const Payments = React.lazy(() => import('./modules/courses/Payments'));
const Refund = React.lazy(() => import('./modules/courses/RefundPage'));
const Messages = React.lazy(() => import('./modules/courses/Messages'));
const Users = React.lazy(() => import('./modules/courses/Users'));

const DeviceDashboard  = React.lazy(() => import('./modules/devices/DeviceDashboard'));
const DeviceCommandHistory  = React.lazy(() => import('./modules/devices/DeviceCommandHistory'));
const Devices  = React.lazy(() => import('./modules/devices/Devices'));
const Sensors  = React.lazy(() => import('./modules/devices/Sensors'));

const AnalyticsDashboard  = React.lazy(() => import('./modules/analytics/dashboard/Dashboard'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/modules/admin', exact: true, name: 'Admin', component: AdminDashboard},
  { path: '/modules/admin/dashboard', exact: true, name: 'Dashboard', component: AdminDashboard },
  { path: '/modules/admin/categories', exact: true, name: 'Categories', component: Categories },
  { path: '/modules/admin/courses', exact: true, name: 'Courses', component: Courses },
  { path: '/modules/admin/courses/:id', exact: true, name: 'Sections', component: Sections },
  { path: '/modules/admin/courses/:id/:id', name: 'Topics', component: Topics },

  { path: '/modules/admin/orders', name: 'Orders', component: Orders },  
  { path: '/modules/admin/payments', name: 'Payments', component: Payments },
  { path: '/modules/admin/refund', name: 'Refund', component: Refund },
  { path: '/modules/admin/messages', name: 'Messages', component: Messages },
  { path: '/modules/admin/users', name: 'Users', component: Users },

  { path: '/modules/devicemanagement',exact: true, name: 'Device Management', component: DeviceDashboard },
  { path: '/modules/devicemanagement/dashboard', exact: true, name: 'Dashboard', component: DeviceDashboard },
  { path: '/modules/devicemanagement/dashboard/:id', exact: true, name: 'Command History', component: DeviceCommandHistory },
  { path: '/modules/devicemanagement/devices', exact: true, name: 'Devices', component: Devices },
  { path: '/modules/devicemanagement/devices/:id', exact: true, name: 'Sensors', component: Sensors },

  { path: '/modules/analytics', exact: true, name: 'Analytics', component: AnalyticsDashboard },
  { path: '/modules/analytics/dashboard', name: 'Dashboard', component: AnalyticsDashboard },

];

export default routes;
